A plugin object can be created by calling the node.NewPlugin method. The method creates and returns a new plugin object, as well as registers it so that GoShimmer knows the plugin is available. It accepts the following arguments: name string - plugin name. status int - flag indicating whether plugin is enabled or disabled by default. This can be overridden by enabling/disabling the plugin in the external configuration file. Possible values: node.Enabled, node.Disabled. callbacks ...Callback - list of event handler functions. The method will correctly create a plugin when passing up to 2 callbacks. Note: type Callback = func(plugin *Plugin), which is a raw function type without being wrapped in events.Closure. There is a couple of ways that the method can be called, depending on which plugin events need to be configured. Define Configure and Run event handlers. It's the most common usage that plugins currently use. plugin = node.NewPlugin(PluginName, node.Enabled, configure, run) Define only Configure event. It's used for plugins that are used to configure objects used (or managed) by other plugins, such as creating API endpoints. plugin = node.NewPlugin(PluginName, node.Enabled, configure) Define a plugin without Configure or Run event handlers. This is used to create plugins that perform some action when the Init event is triggered. plugin = node.NewPlugin(PluginName, node.Enabled) However, the Init event handler cannot be attached using the node.NewPlugin method. In order to specify this handler, plugin creator needs to attach it manually to the event, for example inside the package's init() method in the file containing the rest of the plugin definition. func init() { plugin.Events.Init.Attach(events.NewClosure(func(*node.Plugin) { // do something }))
} It's important to note, that the node.NewPlugin accepts handler functions in a raw format, that is, without being wrapped by the events.Closure object as the method does the wrapping inside. However, when attaching the Init event handler manually, it must be wrapped by the events.Closure object. It's crucial that each plugin is created only once and sync.Once class is used to guarantee that. Contents of a file containing sample plugin definition is presented. All plugins follow this format. const PluginName = "SamplePlugin" var ( // plugin is the plugin instance of the new plugin plugin. plugin *node.Plugin pluginOnce sync.Once
) // Plugin gets the plugin instance.
func Plugin() *node.Plugin { pluginOnce.Do(func() { plugin = node.NewPlugin(PluginName, node.Enabled, configure, run) }) return plugin
} // Handler functions
func init() { plugin.Events.Init.Attach(events.NewClosure(func(*node.Plugin) { // do something }))
}
func configure(_ *node.Plugin) { // configure stuff
} func run(*node.Plugin) { // run stuff }

