Below are the steps that show the example code necessary to create a custom event, attach a handler and trigger the event. Create a function that will call event handlers (handler caller) for a specific event. Each event has only one handler caller. It enforces that all handlers for the event must share the same interface, because the caller will pass a fixed set of arguments of specific types to handler function. It's not possible to pass different number of arguments or types to the handler function. Callers for all events must also share the same interface - the first argument represents the handler function that will be called represented by a generic argument. Further arguments represent parameters that will be passed to the handler during execution. Below are example callers that accept one and two parameters respectively. More arguments can be passed in similar manner. func singleArgCaller(handler interface{}, params ...interface{}) { handler.(func (*Plugin))(params[0].(*Plugin))
} func twoArgsCaller(handler interface{}, params ...interface{}) { handler.(func(*peer.Peer, error))(params[0].(*peer.Peer), params[1].(error))
} handler.(func (*Plugin))(params[0].(*Plugin)) - this code seems a little complicated, so to make things simpler we will divide into smaller parts and explain each: handler.(func (*Plugin)) (A) - this part does type-cast the handler from generic type onto type of desired, specific function type - in this case it's a function that accepts *Plugin as its only parameter. params[0].(*Plugin) (B)- similarly to previous part, first element of parameter slice is type-casted onto *Plugin type, so that it matches the handler function interface. handler.(func (*Plugin))(params[0].(*Plugin)) - the whole expression calls the type-casted handler function with the type-casted parameter value. We can also write this as A(B) to make things simpler. The above explanation also allows a better understanding of why all handlers must share the same interface - handler caller passes fixed number of parameters and does type-casting of arguments onto specific types. Next, a new event object needs to be created. We pass the handler caller as an argument, which is saved inside the object to be called when the event is triggered. import "github.com/iotaledger/hive.go/events" ThisEvent := events.NewEvent(singleArgCaller) After creating the event, handlers (or callbacks) can be attached to it. An event can have multiple callbacks, however they all need to share the same interface. One thing to note, is that functions are not passed directly - first they are wrapped into a events.Closure object like in the example below. ThisEvent.Attach(events.NewClosure(func (arg *Plugin) { // do something
})) In order to trigger the event with some parameters we need to run the .Trigger method on the event object with parameters that handler functions will receive: somePlugin Plugin
ThisEvent.Trigger(&somePlugin)

