The mana plugin is responsible for: calculating mana from value transactions, keeping a log of the different mana values of all nodes, updating mana values, responding to mana related queries from other modules, saving base mana vectors in database when shutting down the node, trying to load base mana vectors from database when starting the node. The proposed mana plugin should keep track of the different mana values of nodes and handle calculation updates. Mana values are mapped to nodeIDs and stored in a map data structure. The vector also stores information on what Type of mana it handles. type BaseManaVector struct { vector map[identity.ID]*BaseMana vectorType Type
} Access Mana and Consensus Mana should have their own respective BaseManaVector. accessManaVector := BaseManaVector{vectorType: AccesMana}
consensusManaVector := BaseManaVector{vectorType: ConsensusMana} In the future, it should be possible to combine Effective Base Mana 1 and Effective Base Mana 2 from a BaseManaVector in arbitrary proportions to arrive at a final mana value that other modules use. The mana package has these methods in place. Additionally, a parameter could be passed to the getMana type of exposed functions to set the proportions. Methods The mana plugin should expose utility functions to other modules: GetHighestManaNodes(type, n) [n]NodeIdManaTuple: return the n highest type mana nodes (nodeID,manaValue) in ascending order. Should also update their mana value. GetManaMap(type) map[nodeID]manaValue: return type mana perception of the node. GetAccessMana(nodeID) mana: access Base Mana Vector of Access Mana, update its values with respect to time, and return the amount of Access Mana (either Effective Base Mana 1, Effective Base Mana 2, or some combination of the two). Trigger ManaUpdated event. GetConsensusMana(nodeID) mana: access Base Mana Vector of Consensus Mana, update its values with respect to time, and returns the amount of Consensus Mana (either Effective Base Mana 1, Effective Base Mana 2, or some combination of the two). Trigger ManaUpdated event. GetNeighborsMana(type): returns the type mana of the nodes neighbors GetAllManaVectors() Obtaining the full mana maps for comparison with the perception of other nodes. GetWeightedRandomNodes(n): returns a weighted random selection of n nodes. Consensus Mana is used for the weights. Obtaining a list of currently known peers + their mana, sorted. Useful for knowing which high mana nodes are online. OverrideMana(nodeID, baseManaVector): Sets the nodes mana to a specific value. Can be useful for debugging, setting faucet mana, initialization, etc.. Triggers ManaUpdated Such utility functions could be used for example to visualize mana distribution in node dashboard, or send neighbor mana data to the analysis server for further processing. Booking Mana Mana is booked when a transaction is confirmed. on TransactionConfirmed (tx): bookAccessMana() bookConsensusMana() Synchronization and Mana Calculation The mana plugin is responsible to determine when to start calculating mana locally. Since mana state is an extension to ledger state, it can only depict realistic mana values once the node is in sync. During syncing, ledger state is constructed from messages coming from neighbors as described further above. In this first iteration, mana plugin relies on TransactionConfirmed event of the value transfers plugin, and has no explicit rules on when to start and stop mana calculation. In future, initial mana state (together with the initial ledger state) will be derived from a snapshot file.
